import {
    QueryClient,
    QueryClientProvider,
    useQuery,
  } from "@tanstack/react-query";

  import { useParams } from 'react-router-dom';

async function getAdminReports(IP, lineId) {
    const response = await fetch(`http://${IP}:3005/adminReports`, {
        method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({
                PLine_id: lineId,
            }),
        });
        return response.json();
    }

async function getNameOfLine(IP, lineId) {
    const response = await fetch(`http://${IP}:3005/adminReports`, {
        method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({
                PLine_id: lineId,
            }),
        });
        return response.json();
    }
    


const IP = '10.10.195.44'



function Reports() {
    const { lineId } = useParams();
    const {isLoading, data: reports} = useQuery({queryKey: ['reports'], queryFn: async () => await getAdminReports(IP, lineId), initialData: []});
    const {data: lineName} = useQuery({queryKey: ['lineName'], queryFn: async () => await getNameOfLine(IP, lineId), initialData: []});

if (isLoading) {
    return <span>Loading...</span>
    }

    return (
    
        <div className="ml-16 mt-16">
            <div className=" relative border w-5/6 rounded-3xl overflow-hidden">
                <table className="w-full text-lg text-left text-black-500 dark:text-gray-400 overflow-hidden ">
                    <thead>
                        <tr className="bg-slate-500 border-b">
                            <td className="pl-5 pt-2 pb-2"></td>
                            <td></td>
                            <td></td>
                        </tr>
                        <tr className="bg-slate-500 border-b">
                            <td className="pl-5 pt-2 pb-2">#</td>
                            <td className="pl-5 pt-2 pb-2">date</td>
                            <td className="pl-5 pt-2 pb-2">export Btn</td>
                        </tr>
                    </thead>
                    <tbody>
                        {reports.map((report) => {
                            return (
                                <tr className={` border-b  hover:bg-slate-200`}>
                                    <td className="px-3 py-3">{report.FReport_id}</td>
                                    <td className="px-3 py-3">{report.FReport_time}</td>
                                    <td className="px-3 py-3"><button className="bg-slate-300 hover:bg-slate-400 rounded-full pt-2 pb-2 pl-5 pr-5">Export</button></td>
                                </tr>
                            )
                        })}
                    </tbody>
                </table>
            </div>
        </div>
        );
    }

export default Reports;
